import React, { useEffect, useState } from 'react';

function SidebarSites() {

    return (

        <>
            <div class="sidebar">
                <ul>
                    <li class="active"><a href=""><i class="fad fa-sitemap"></i> <span>Sites</span></a></li>
                    <li><a href=""><i class="fad fa-globe"></i> <span>Domains</span></a></li>
                    <li><a href=""><i class="fad fa-pen-fancy"></i> <span>Themes</span></a></li>
                    <li><a href=""><i class="fad fa-plug"></i> <span>Plugins</span></a></li>
                </ul>
            </div>
        </>

    );

}

export default SidebarSites;
